- input: '"TEXT","F3XN","C00032334","All disbursements and expenditures for TELEMARKETING
    - NEGOP, NEGOP FUNDRAISING MAIL and POSTAGE - NEGOP FUNDRAISING MAIL were for
    fundraising purposes for the state party only; no federal candidate or federal
    officeholder was identified in any of these events.  No disbursements for rent
    appear on the report as the Nebraska Republican Party owns the building from which
    the organization operates and therefore does not make rental payments.  All disbursements
    and expenditures for FEA SLATE CARD PRODUCTION were for Party Slate Cards including
    at least three candidates and were not distributed through general public advertising.  All
    disbursements for FEA GOTV CALLS (GENERIC) were for generic Get-Out-The-Vote calls
    and did not mention any specific candidate.  Non-federal funds were not used in
    connection with any federal election or federal election activity."'
